import Header from "./components/Header";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        {/* Основное содержимое страницы */}
        <h1>Добро пожаловать на наш сайт!</h1>
      </main>
      <Footer />
    </div>
  );
}

export default App;
